import { useEffect, useState } from "react";

export default function App() {
  return <Header />;
}

function Header() {
  return (
    <div className="header">
      <nav>
        <h1>Ararat Designs</h1>
      </nav>

      <nav className="nav-bar">
        <h3>Home</h3>
        <h3>About</h3>
        <h3>Clients</h3>
        <h3>Supports</h3>
      </nav>

      <nav>
        <h3>Get in touch</h3>
      </nav>
    </div>
  );
}
